import { IconButton, Typography,AppBar,Toolbar,Button,Box,Grid, ButtonGroup} from "@material-ui/core";
import MenuIcon from '@material-ui/icons/Menu';const In=()=>{
    return(
<Box>
    <Appbar/>
    <Grid container>
        <Grid item xs={12}>
            <Typography variant="h4" style={{color:"grey"}}>
                Inbound
            </Typography>
        </Grid>
        <Grid item xs={3} alignItems="right" justify="right">
            <ButtonGroup>
                <Button></Button>
                <Button></Button>
                <Button></Button>
            </ButtonGroup>
        </Grid>
    </Grid>
</Box>
    );
}
export default In;
const Appbar = ()=>{
    return(
    <AppBar position="static">
    <Toolbar>
        <IconButton edge="start">
            <MenuIcon/>
        </IconButton>
        <Typography variant="h6" style={{flexGrow:1}}>
            In/Out Stock
        </Typography>
        <Button color="inherit">
            Logout
        </Button>
    </Toolbar>
</AppBar>
    );
}
